const useStyles = makeStyles((theme) => ({
    card: {
      margin: 10,
       // Adjust the value as needed (2 * 8px = 16px)
    },
}));

function StockCard({id, symbol, companyName, bsePrice, nsePrice}) {
  return (
    <Card sx={{ maxWidth: 50 }}>
        <CardContent>
            <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
            Word of the Day
            </Typography>
        </CardContent>
    </Card>
  )
}

